[[package]]
name = "kombu"
version = "5.1.0"
description = "Messaging library for Python."
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
amqp = ">=5.0.6,<6.0.0"
cached-property = {version = "*", markers = "python_version < \"3.8\""}
